import React from 'react';


const GoalList = (props) => {
  return (
      <table className="table table-hover">
        <thead>
          <tr>
            <th scope='col'>#</th>
            <th scope='col'></th>
            <th scope='col'></th>
            <th scope='col'></th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope='row'>#</th>
            <td></td>
            <td></td>
            <td></td>
          </tr>
        </tbody>
      </table>
  );
};

export default GoalList;
